import React from 'react';
import './App.css';

function UserItem({ item, onDelete, onUpdate }) {
    console.log("item = " + item)
    return (
        <div className='row m-2'>
            <tr key={item._id}>
                <td>{item?.first_name}</td>
                <td>{item?.last_name}</td>
                <td>{item?.primary_address?.street_address || ''}</td>
                <td>{item?.primary_address?.Province || ''}</td>
                <td>{item?.primary_address?.PostalCode || ''}</td>
                <td>
                    <button className="btn btn-warning btn-sm float-end" onClick={() => onDelete(item?._id)}>Delete</button>
                    <button className="btn btn-warning btn-sm float-end" onClick={() => onUpdate(item?._id)}>Update</button>
                </td>
            </tr>
        </div>
    );
}

export default UserItem;
